from itertools import count
import numpy as np
from matplotlib import figure, pyplot as plt
from map import get_roads


def lower_bounds(nums,target):
    l,r = 0,len(nums)-1
    res = len(nums)
    while l < r:
        mid = (l + r) // 2
        if nums[mid] < target:
            l = mid + 1
        else:
            r = mid
    if nums[l] >= target:
        res = l
    return res

def get_terrain():
    roads = get_roads()
    total_dis = []
    dx = 100
    heights = []
    for road in roads:
        if len(total_dis) == 0:
            total_dis.append(road.road_length)
        else:
            total_dis.append(total_dis[len(total_dis)-1] + road.road_length)
    for x_i in range(0,212):
        road_id = lower_bounds(total_dis,x_i * dx)
        heights.append(roads[road_id].start_point[2])
    #plt.plot(np.arange(0,212*dx,dx),heights)
    #plt.show()
    return heights



def smooth(datas,fig,datas2):
    fig = plt.figure()
    colors = ['red','green','blue','orange']
    for i in range(len(datas[1])):
        datas[2].append(datas[3][i] * 1 + (datas[1][i] - datas[0][i]) * 0.4)
    datas[0],datas[1],datas[2],datas[3] = datas[2],datas[3],datas[1],datas[0]

    for i in range(len(datas2[1])):
        datas2[2].append(datas2[3][i] * 1 + (datas2[1][i] - datas2[0][i]) * 0.4)
    datas2[0],datas2[1],datas2[2],datas2[3] = datas2[2],datas2[3],datas2[1],datas2[0]    


    terr = get_terrain()
    datas = [datas2[0],datas[0],terr]
    for k in range(3):
        data = datas[k]
        ax = fig.add_subplot(3, 1, k+1)
        ax.set_visible(True)
        x = np.linspace(0, len(data) * 100 - 100, len(data))
        if k < 2:
            for i in range(len(data)):
                count = 0
                temp = 0
                for j in range(i - 5, i + 6):
                    if j > 0 and j < len(data):
                        temp += data[j]
                        count += 1
                data[i] = temp / count
        if k < 2:
            ax.set_xticks([])
        #ax.set_yticks([0,100,200,300,400])
        ax.plot(x, data, color = colors[k])
    plt.show()

